import React from 'react';
import StoryDetailPage from './components/StoryDetailPage';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <nav>
          <a href="/">HOME</a>
          <a href="/login">LOGIN</a>
        </nav>
      </header>
      <main>
        <StoryDetailPage storyId={1} />
      </main>
    </div>
  );
}

export default App;
